function initHelpCrunch() {
    if (window.HelpCrunch) return;

    window.helpcrunchSettings = {
        organization: 'viyar',
        appId: 'e33ab2ec-5283-4da9-af65-dfa8c225a0c3',
    };

    (function (w, d) {
        var hS = w.helpcrunchSettings;
        if (!hS || !hS.organization) return;

        var widgetSrc = 'https://' + hS.organization + '.widget.helpcrunch.com/';
        w.HelpCrunch = function () {
            w.HelpCrunch.q.push(arguments);
        };
        w.HelpCrunch.q = [];

        var firstMessageSent = false;

        w.HelpCrunch('onCustomerMessage', function(message) {
            if (!firstMessageSent) {
                firstMessageSent = true;
                HelpCrunch('updateUser', {
                    user_id: '',
                    name:    '',
                    email:   '',
                    phone:   '+',
                    company: 'my company'
                });
            }
        });

        function loadWidget() {
            if (d.querySelector('script[src="' + widgetSrc + '"]')) return;

            var s = d.createElement('script');
            s.async = 1;
            s.type = 'text/javascript';
            s.src = widgetSrc;
            (d.body || d.head).appendChild(s);
        }

        loadWidget();
    })(window, document);
}

// Прив'язка до кліку по кнопці
document.addEventListener('DOMContentLoaded', function () {
    const widgetButton = document.querySelector('.widget-helpcrunch-container');
    if (widgetButton) {
        widgetButton.addEventListener('click', function () {
            $('.widget-helpcrunch-container').remove();
            initHelpCrunch();
            let interval = setInterval(() => {
                if (typeof window.HelpCrunch === 'function') {
                    window.HelpCrunch('openChat');
                    clearInterval(interval);
                }
            }, 300);
        }, { once: true });
    }
});

