$("#callbackPhone").onclick = function () {
    // поиск порядкового номера последней цифры в строке и перенос туда курсора
    let input = $("#callbackPhone").val();
    let res = input.match(/\d(?=\D*$)/) || [];
    let num = parseInt(res["index"]) + 1;
    $("#callbackPhone").setSelectionRange(num, num);
}
$("#callbackPhone").mask("+38 099 999 99 99");
